import React, {Component} from 'react';
import Marker from './Marker';

export default class ShelterAPI extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            entries: []
        }
    }
    componentDidMount() {
      this.fetchApiToEntries('http://localhost:5000/api/shelters');
    }
    fetchApiToEntries = (apiToFetch) => {
        fetch(apiToFetch)
            .then(result => result.json())
            .then((entries) => {
                this.setState({
                    ...this.state,
                    entries
                })
            })
            .catch((error) => console.log(error));
    }
    render() {
      const {entries} = this.state;
        console.log(entries);
        return (
            <div className="App">
            <h1>Users</h1>
            {entries.map(entry =>
                    <Marker
                    text={entry.address}
                    lat={entry.latitude}
                    lng={entry.longitude}
                />
          )}
        </div>
        )
    }
}
